import React from "react";
import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";

function Leftpanel() {
  return (
    <div>
      <Router>
        <Link to="">Home1</Link>
        <Link to="/states">Home1</Link>
        <Link to="">Home1</Link>

        <Route path="" component={Leftpanel} />
      </Router>
    </div>
  );
}

export default Leftpanel;
